#Set new entrance
DELIMITER //
CREATE PROCEDURE setNewEntrance
(IN IN_entrance_ip varchar(24), IN_entrance_country varchar(45))
BEGIN
	VALUES (IN_entrance_ip,IN_entrance_country,NOW(),null);
END //
DELIMITER ;

#getEntranceId
DELIMITER //
CREATE PROCEDURE getEntranceId
(IN IN_entrance_ip VARCHAR(24))
BEGIN
	SELECT  MAX(id) From djaroodb.entrance
	WHERE ip = IN_entrance_ip;
END //
DELIMITER ;

#setNewConsultationProcess
DELIMITER //
CREATE PROCEDURE setNewConsultationProcess
(IN IN_entrance_id INT, IN_product_id INT)
BEGIN
	Values (IN_entrance_id,IN_product_id,now(),null);
END //
DELIMITER ;

# newEntrance
DELIMITER //
CREATE PROCEDURE newEntrance
(IN IN_entrance_ip varchar(24), IN_entrance_country varchar(45))
BEGIN
CALL setNewEntrance(IN_entrance_ip,IN_entrance_country);
CALL getEntranceId(IN_entrance_ip);
END //
DELIMITER ;

# getConsultationProcessId
DELIMITER //
CREATE PROCEDURE getConsultationProcessId
(IN IN_entrance_id INT)
BEGIN
	SELECT  MAX(id) from djaroodb.consultation_process
	WHERE entrance_id = IN_entrance_id;
END //
DELIMITER ;

#getProductAffiliations
DELIMITER //
CREATE PROCEDURE getProductAffiliations
(IN IN_product_id INT)
BEGIN
	SELECT  id, name,description From djaroodb.affiliation 
	WHERE product_id = IN_product_id;
END //
DELIMITER ;

#set Uses

#get Uses
DELIMITER //
CREATE PROCEDURE getUses
(IN IN_product_id INT)
BEGIN
	SELECT id,name From djaroodb.`use`
	WHERE product_id = IN_product_id;
END //
DELIMITER ;

#get Level of use for view call
DELIMITER //
CREATE PROCEDURE getLevelsOfUse
(IN IN_product_id INT)
BEGIN
	SELECT use_id,use_name, value From djaroodb.level_of_use
	WHERE product_id = IN_product_id;
END //
DELIMITER ;





DELIMITER //
CREATE PROCEDURE getQuestionsAndAnswers
(IN IN_product_id INT)
BEGIN
	SELECT question_id,question_header, question_content, id as answer_id, name as answer_name From djaroodb.answer
	WHERE product_id = IN_product_id;
END //
DELIMITER ;



